import Axios from 'axios'

const RetrieveLogin = () => {
    Axios.get("http://localhost:4500/view-all").then( (response) => {
      console.log("Retrieved login data");
      console.log(response)
      const LoginData=response.data
      return LoginData    
    });
  };

LoginTable = () => {
  {LoginData.map((val, key) => {
  return (<div>
    {val.websiteName}
    </div>)})}}


export default LoginTable;
